import React from "react";
import Ingredients from "../Ingredient/Ingredient";
export default function IngredientsList({ Ingredients }) {
  const IngredientElement = Ingredients.map((ingredient) => {
    return <IngredientElement ingredient={ingredient} key={ingredient} />;
  });
  return <div>IngredientsList</div>;
}
